export const Container = styled.div`
  top: 0px;
  left: 0px;
  width: 100%;
  height: 100%;
  background: #f5f5f5 0% 0% no-repeat padding-box;
  opacity: 1;
`;

export const OrderContent = styled.div`
  width: 100%;
  max-width: 1200px;
`;
